import canCompleteCircuit from "../../src/array/canCompleteCircuit"

test("Input: gas = [1,2,3,4,5], cost = [3,4,5,1,2]; Output: 3", () => {
    const gas = [1,2,3,4,5], cost = [3,4,5,1,2]
    expect(canCompleteCircuit(gas, cost)).toBe(3)
})

test("Input: gas = [2,3,4], cost = [3,4,3]; Output: -1", () => {
    const gas = [2,3,4], cost = [3,4,3]
    expect(canCompleteCircuit(gas, cost)).toBe(-1)
})

test("Corner Case: start from index 0", () => {
    const gas = [3,1,1], cost = [1,2,2]
    expect(canCompleteCircuit(gas, cost)).toBe(0)
})

